import React from 'react'
import Container from 'react-bootstrap/Container';
import 'bootstrap/dist/css/bootstrap.min.css';

const About = () => {
  return (
    <section id="about">
      <div className='about-one'>
        <h1>ABOUT</h1>
      </div>
      <div className='about-two'>
        <p>I am a dedicated Software Engineer, committed to continuously learning new technologies and languages to further develop my craft. In the past I have experimented with different business initiatives in different areas that piqued my interest. This process has taught me a huge amount and am now looking to develop my entrepreneurial spirit with a progressive busines where I can learn from some of the best in web development.</p>
        <p>It's an exciting time to be a developer and I look forward to the oppurtunities ahead and the products that have yet to be built. I love learning new languages and testing the limits of my own code, while experimenting with my different projects.</p>
      </div>
    </section>
  )
}

export default About;
